const Profile = () => {
  return (
    <div className="main-profile-wrapper">
      <div className="main-profile-header">
        <tbody>
          <tr>
            <td>1</td>
            <td>2</td>
            <td>3</td>
            <td>4</td>
            <td>5</td>
          </tr>
        </tbody>
      </div>
      <div className="main-profile-content">
        <thead className="main-profile-content-thead">1</thead>
        <tbody className="main-profile-content-tbody">2</tbody>
        <tfoot className="main-profile-content-tfoot">3</tfoot>
      </div>
    </div>
  );
};

export default Profile;
